import React, { useEffect, useState }  from "react";
import {   
  Card,
  CardHeader,
  CardBody,
  CardFooter,
  CardTitle,
  Row,
  Col,} from "reactstrap";


import { drawBubble } from './charts/BubbleChart.js';
import { drawMap } from './charts/MapChart.js';
import { drawMapbox } from './charts/MapboxChart.js';
import { drawSankey } from './charts/SankeyChart.js';


function Geography() {
  const [data, setData] = useState([]);

  useEffect(() => {
      drawBubble(400, 600);
  }, []);

  useEffect(() => {
    drawMap(400, 600);
  }, []);

  useEffect(() => {
    drawMapbox(400, 600);
  }, []);

  useEffect(() => {
    drawSankey(400, 600);
  }, []);

  return (
    <>
      <div className="content">
      <Row>
          <Col lg="3" md="6" sm="6">
            <Card className="card-stats">
              <CardBody>
                <Row>
                  <Col md="4" xs="5">
                    <div className="icon-big text-center icon-warning">
                      <i className="nc-icon nc-single-02 text-warning" />
                    </div>
                  </Col>
                  <Col md="8" xs="7">
                    <div className="numbers">
                      <p className="card-category">Number of cancer patients treated at the hospital (per 10k)</p>
                      <CardTitle tag="p">0.76</CardTitle>
                      <p />
                    </div>
                  </Col>
                </Row>
              </CardBody>
              <CardFooter>
                <hr />
                <div className="stats">
                </div>
              </CardFooter>
            </Card>
          </Col>
          <Col lg="3" md="6" sm="6">
            <Card className="card-stats">
              <CardBody>
                <Row>
                  <Col md="4" xs="5">
                    <div className="icon-big text-center icon-warning">
                      <i className="nc-icon nc-chart-pie-36 text-success" />
                    </div>
                  </Col>
                  <Col md="8" xs="7">
                    <div className="numbers">
                      <p className="card-category">zip code with most cancer patients treated at the hospital</p>
                      <CardTitle tag="p">90650</CardTitle>
                      <p />
                    </div>
                  </Col>
                </Row>
              </CardBody>
              <CardFooter>
                <hr />
                <div className="stats">
                </div>
              </CardFooter>
            </Card>
          </Col>
          <Col lg="3" md="6" sm="6">
            <Card className="card-stats">
              <CardBody>
                <Row>
                  <Col md="4" xs="5">
                    <div className="icon-big text-center icon-warning">
                      <i className="nc-icon nc-vector text-danger" />
                    </div>
                  </Col>
                  <Col md="8" xs="7">
                    <div className="numbers">
                      <p className="card-category">Average distance to the hospital (miles)</p>
                      <CardTitle tag="p">28.0</CardTitle>
                      <p />
                    </div>
                  </Col>
                </Row>
              </CardBody>
